    instructions[4314] = {6'd14, 4'd0, 4'd6, 16'd0};///usr/local/lib/python2.7/dist-packages/chips/compiler/include/time.h : 411 {'a': 6, 'trace': /usr/local/lib/python2.7/dist-packages/chips/compiler/include/time.h : 411, 'op': 'return'}
  end

  
  always @(posedge clk)
  begin
    load_data <= memory[load_address];
    if(store_enable && state == execute) begin
      memory[store_address] <= store_data;
    end
  end


  //////////////////////////////////////////////////////////////////////////////
  // PIPELINE STAGE 1 -- FETCH INSTRUCTION
  //                                                                            
  
  always @(posedge clk)
  begin
    //implement memory for instructions
    if (state == instruction_fetch || state == operand_fetch || state == execute) begin
      instruction <= instructions[program_counter];
      program_counter_1 <= program_counter;
    end
  end

  assign opcode    = instruction[29:24];
  assign address_z = instruction[23:20];
  assign address_a = instruction[19:16];
  assign address_b = instruction[3:0];
  assign literal   = instruction[15:0];

  //////////////////////////////////////////////////////////////////////////////
  // PIPELINE STAGE 2 -- FETCH OPERANDS
  //                                                                            
  
  always @(posedge clk)
  begin
    if (write_enable) begin
      registers[address_z_3] <= result;
    end
    if (state == operand_fetch || state == execute) begin
      opcode_2 <= opcode;
      literal_2 <= literal;
      address_a_2 <= address_a;
      address_b_2 <= address_b;
      address_z_2 <= address_z;
      program_counter_2 <= program_counter_1;
    end
  end
  assign register_a = registers[address_a_2];
  assign register_b = registers[address_b_2];
  assign operand_a = (address_a_2 == address_z_3 && write_enable)?result:register_a;
  assign operand_b = (address_b_2 == address_z_3 && write_enable)?result:register_b;
  assign store_address = operand_a;
  assign load_address = operand_a;
  assign store_data = operand_b;
  assign store_enable = (opcode_2==2);

  //////////////////////////////////////////////////////////////////////////////
  // PIPELINE STAGE 3 -- EXECUTE
  //                                                                            
  
  always @(posedge clk)
  begin

  write_enable <= 0;
  timer_clock <= timer_clock + 1;
  case(state)

    //instruction_fetch
    instruction_fetch: begin
      program_counter <= program_counter + 1;
      state <= operand_fetch;
    end
    //operand_fetch
    operand_fetch: begin
      program_counter <= program_counter + 1;
      state <= execute;
    end
    //execute
    execute: begin
      program_counter <= program_counter + 1;
      address_z_3 <= address_z_2;
      case(opcode_2)

        //literal
        16'd0:
        begin
          result<=$signed(literal_2);
          write_enable <= 1;
        end

        //addl
        16'd1:
        begin
          result<=operand_a + literal_2;
          write_enable <= 1;
        end

        //store
        16'd2:
        begin
        end

        //int_to_long
        16'd3:
        begin
          if(operand_a[31]) begin
            result <= -1;
          end else begin
            result <= 0;
          end
          write_enable <= 1;
        end

        //call
        16'd4:
        begin
          result <= program_counter_2 + 1;
          write_enable <= 1;
          program_counter <= literal_2;
          state <= instruction_fetch;
        end

        //stop
        16'd5:
        begin
        state <= stop;
        end

        //load
        16'd6:
        begin
          state <= load;
        end

        //ready
        16'd7:
        begin
          result <= 0;
          case(operand_a)

            1:
            begin
              result[0] <= input_rs232_rx_stb;
            end
          endcase
          write_enable <= 1;
        end

        //jmp_if_false
        16'd8:
        begin
          if (operand_a == 0) begin
            program_counter <= literal_2;
            state <= instruction_fetch;
          end
        end

        //read
        16'd9:
        begin
          state <= read;
          read_input <= operand_a;
        end

        //goto
        16'd10:
        begin
          program_counter <= literal_2;
          state <= instruction_fetch;
        end

        //subtract
        16'd11:
        begin
          long_result = operand_a + (~operand_b) + 1;
          result <= long_result[31:0];
          carry[0] <= ~long_result[32];
          write_enable <= 1;
        end

        //literal_hi
        16'd12:
        begin
          result<= {literal_2, operand_a[15:0]};
          write_enable <= 1;
        end

        //wait_clocks
        16'd13:
        begin
          timer <= operand_a;
          state <= wait_state;
        end

        //return
        16'd14:
        begin
          program_counter <= operand_a;
          state <= instruction_fetch;
        end

        //add
        16'd15:
        begin
          long_result = operand_a + operand_b;
          result <= long_result[31:0];
          carry[0] <= long_result[32];
          write_enable <= 1;
        end

        //write
        16'd16:
        begin
          state <= write;
          write_output <= operand_a;
          write_value <= operand_b;
        end

        //equal
        16'd17:
        begin
          result <= operand_a == operand_b;
          write_enable <= 1;
        end

        //multiply
        16'd18:
        begin
          long_result = operand_a * operand_b;
          result <= long_result[31:0];
          carry <= long_result[63:32];
          write_enable <= 1;
        end

        //greater_equal
        16'd19:
        begin
          result <= $signed(operand_a) >= $signed(operand_b);
          write_enable <= 1;
        end

        //subtract_with_carry
        16'd20:
        begin
          long_result = operand_a + (~operand_b) + carry[0];
          result <= long_result[31:0];
          carry[0] <= ~long_result[32];
          write_enable <= 1;
        end

        //add_with_carry
        16'd21:
        begin
          long_result = operand_a + operand_b + carry[0];
          result <= long_result[31:0];
          carry[0] <= long_result[32];
          write_enable <= 1;
        end

        //not_equal
        16'd22:
        begin
          result <= operand_a != operand_b;
          write_enable <= 1;
        end

        //carry
        16'd23:
        begin
          result <= carry;
          write_enable <= 1;
        end

        //timer_low
        16'd24:
        begin
          result <= timer_clock[31:0];
          write_enable <= 1;
        end

        //timer_high
        16'd25:
        begin
          result <= timer_clock[63:32];
          write_enable <= 1;
        end

        //unsigned_greater
        16'd26:
        begin
          result <= $unsigned(operand_a) > $unsigned(operand_b);
          write_enable <= 1;
        end

        //and
        16'd27:
        begin
          result <= operand_a & operand_b;
          write_enable <= 1;
        end

        //or
        16'd28:
        begin
          result <= operand_a | operand_b;
          write_enable <= 1;
        end

        //shift_left
        16'd29:
        begin
          if(operand_b < 32) begin
            result <= operand_a << operand_b;
            carry <= operand_a >> (32-operand_b);
          end else begin
            result <= 0;
            carry <= operand_a;
          end
          write_enable <= 1;
        end

        //shift_left_with_carry
        16'd30:
        begin
          if(operand_b < 32) begin
            result <= (operand_a << operand_b) | carry;
          end else begin
            result <= carry;
          end
          write_enable <= 1;
        end

        //greater
        16'd31:
        begin
          result <= $signed(operand_a) > $signed(operand_b);
          write_enable <= 1;
        end

        //unsigned_greater_equal
        16'd32:
        begin
          result <= $unsigned(operand_a) >= $unsigned(operand_b);
          write_enable <= 1;
        end

        //jmp_if_true
        16'd33:
        begin
          if (operand_a != 0) begin
            program_counter <= literal_2;
            state <= instruction_fetch;
          end
        end

      endcase

    end

    read:
    begin
      case(read_input)
      1:
      begin
        s_input_rs232_rx_ack <= 1;
        if (s_input_rs232_rx_ack && input_rs232_rx_stb) begin
          result <= input_rs232_rx;
          write_enable <= 1;
          s_input_rs232_rx_ack <= 0;
          state <= execute;
        end
      end
      endcase
    end

    write:
    begin
      case(write_output)
      0:
      begin
        s_output_rs232_tx_stb <= 1;
        s_output_rs232_tx <= write_value;
        if (output_rs232_tx_ack && s_output_rs232_tx_stb) begin
          s_output_rs232_tx_stb <= 0;
          state <= execute;
        end
      end
      endcase
    end

    load:
    begin
        result <= load_data;
        write_enable <= 1;
        state <= execute;
    end

    wait_state:
    begin
      if (timer) begin
        timer <= timer - 1;
      end else begin
        state <= execute;
      end
    end

    stop:
    begin
    end

    endcase

    if (rst == 1'b1) begin
      timer <= 0;
      timer_clock <= 0;
      program_counter <= 0;
      address_z_3 <= 0;
      result <= 0;
      a = 0;
      b = 0;
      z = 0;
      state <= instruction_fetch;
      s_input_rs232_rx_ack <= 0;
      s_output_rs232_tx_stb <= 0;
    end
  end
  assign input_rs232_rx_ack = s_input_rs232_rx_ack;
  assign output_rs232_tx_stb = s_output_rs232_tx_stb;
  assign output_rs232_tx = s_output_rs232_tx;

endmodule
